import React from "react";
import { Button, Box, TextField, Grid } from "@mui/material";
import "./index.css";

function Login() {
  return (
    <Grid container spacing={1} rows={3}>
      <Box
        sx={{
          display: "grid",
          gridAutoRows: "140px",
          gap: 1,
          background: "yellow",
        }}
      >
        <Grid item xs={8}>
          <TextField
            fullWidth
            id="outlined-basic"
            label="Username"
            variant="outlined"
          />
        </Grid>
        <Grid item xs={8}>
          <TextField
            fullWidth
            id="outlined-password-input"
            label="Password"
            type="password"
          />
        </Grid>
        <Grid item xs={8}>
          <Button fullWidth variant="contained">
            Login
          </Button>
        </Grid>
      </Box>
    </Grid>
  );
}

export default Login;
